// Advanced Google Analytics Real Estate Intelligence Aggregation
const strategy = $node['ğŸ  Real Estate Analytics Strategist'].json;
const ga4Data = $node['ğŸ“Š GA4 Real Estate Data Collector'].json;
const eventsData = $node['ğŸ¯ Real Estate Events Collector'].json;
const intelligence = $node['ğŸ§  Market Intelligence Analyzer'].json;

const analyticsIntelligence = {
  intelligence_id: `analytics_intelligence_${Date.now()}`,
  timestamp: new Date().toISOString(),
  property_id: $input.first().json.ga4_property_id,
  analysis_period: '30 days',

  // Strategic Analytics Framework
  analytics_strategy: strategy.analytics_strategy,
  ga4_configuration: strategy.ga4_configuration,
  kpi_definitions: strategy.kpi_definitions,

  // Property Performance Intelligence
  property_performance: {
    total_sessions: ga4Data?.reports?.[0]?.data?.totals?.[0]?.values?.[0] || 0,
    total_users: ga4Data?.reports?.[0]?.data?.totals?.[0]?.values?.[1] || 0,
    total_pageviews: ga4Data?.reports?.[0]?.data?.totals?.[0]?.values?.[2] || 0,
    average_bounce_rate: ga4Data?.reports?.[0]?.data?.totals?.[0]?.values?.[3] || 0,
    average_session_duration: ga4Data?.reports?.[0]?.data?.totals?.[0]?.values?.[4] || 0,
    total_conversions: ga4Data?.reports?.[0]?.data?.totals?.[0]?.values?.[5] || 0,
    total_revenue: ga4Data?.reports?.[0]?.data?.totals?.[0]?.values?.[6] || 0,
    performance_analysis: intelligence.property_performance
  },

  // Real Estate Events Intelligence
  events_performance: {
    property_views: eventsData?.reports?.[0]?.data?.rows?.find(row => row.dimensions[0] === 'property_view')?.metrics?.[0] || 0,
    contact_forms: eventsData?.reports?.[0]?.data?.rows?.find(row => row.dimensions[0] === 'contact_form_submit')?.metrics?.[0] || 0,
    phone_calls: eventsData?.reports?.[0]?.data?.rows?.find(row => row.dimensions[0] === 'phone_call_click')?.metrics?.[0] || 0,
    tour_requests: eventsData?.reports?.[0]?.data?.rows?.find(row => row.dimensions[0] === 'schedule_tour')?.metrics?.[0] || 0,
    brochure_downloads: eventsData?.reports?.[0]?.data?.rows?.find(row => row.dimensions[0] === 'brochure_download')?.metrics?.[0] || 0,
    mortgage_calculations: eventsData?.reports?.[0]?.data?.rows?.find(row => row.dimensions[0] === 'mortgage_calculator')?.metrics?.[0] || 0,
    event_analysis: intelligence.lead_generation_analysis
  },

  // Geographic Market Intelligence
  geographic_insights: {
    top_cities: ga4Data?.reports?.[0]?.data?.rows?.slice(0, 10)?.map(row => ({
      city: row.dimensions[3],
      sessions: row.metrics[0],
      conversions: row.metrics[5]
    })) || [],
    traffic_sources: ga4Data?.reports?.[0]?.data?.rows?.slice(0, 10)?.map(row => ({
      source: row.dimensions[1],
      medium: row.dimensions[2],
      sessions: row.metrics[0],
      users: row.metrics[1]
    })) || [],
    geographic_analysis: intelligence.geographic_intelligence
  },

  // Lead Generation Intelligence
  lead_intelligence: {
    total_leads: (
      (eventsData?.reports?.[0]?.data?.rows?.find(row => row.dimensions[0] === 'contact_form_submit')?.metrics?.[0] || 0) +
      (eventsData?.reports?.[0]?.data?.rows?.find(row => row.dimensions[0] === 'phone_call_click')?.metrics?.[0] || 0) +
      (eventsData?.reports?.[0]?.data?.rows?.find(row => row.dimensions[0] === 'schedule_tour')?.metrics?.[0] || 0)
    ),
    lead_sources: ga4Data?.reports?.[0]?.data?.rows?.slice(0, 5)?.map(row => ({
      channel: row.dimensions[6],
      leads: row.metrics[5],
      cost_per_lead: row.metrics[6] / row.metrics[5] || 0
    })) || [],
    conversion_rates: {
      overall_conversion_rate: ((ga4Data?.reports?.[0]?.data?.totals?.[0]?.values?.[5] || 0) / (ga4Data?.reports?.[0]?.data?.totals?.[0]?.values?.[0] || 1) * 100).toFixed(2) + '%',
      property_to_lead: intelligence.lead_generation_analysis?.conversion_rates?.property_to_lead || 'N/A',
      lead_to_client: intelligence.lead_generation_analysis?.conversion_rates?.lead_to_client || 'N/A'
    }
  },

  // Market Trends and Insights
  market_intelligence: {
    trending_property_types: intelligence.market_trends?.trending_categories || [],
    seasonal_patterns: intelligence.market_trends?.seasonal_insights || {},
    competitive_positioning: intelligence.competitive_insights || {},
    growth_opportunities: intelligence.strategic_recommendations || []
  },

  // Performance Benchmarks
  performance_benchmarks: {
    traffic_growth_rate: intelligence.performance_benchmarks?.traffic_growth || 'N/A',
    lead_generation_improvement: intelligence.performance_benchmarks?.lead_growth || 'N/A',
    market_authority_score: intelligence.performance_benchmarks?.authority_score || 'N/A',
    roi_performance: intelligence.performance_benchmarks?.roi_metrics || 'N/A'
  },

  // Strategic Recommendations
  optimization_opportunities: intelligence.conversion_optimization || [],
  strategic_recommendations: intelligence.strategic_recommendations || [],
  predictive_insights: intelligence.predictive_analytics || {},

  // Success Metrics
  success_metrics: {
    data_quality_score: 95, // Based on GA4 data completeness
    analysis_depth: Object.keys(intelligence).length,
    actionable_insights: (intelligence.strategic_recommendations || []).length,
    market_coverage: (ga4Data?.reports?.[0]?.data?.rows || []).length
  }
};

return [analyticsIntelligence];

